import FeedbackImage from "../imgs/feedbackImage.svg";

const FeedbackForm = (props) => {
    const formSettings = props.formSettings
    return (
        <>
            {formSettings.theme === "dark" ? (
                <div className="w-screen h-screen bg-[#2a2a2a] text-white justify-center items-center flex">
                    <div className="gap-2 bg-white bg-opacity-5 p-8 rounded-lg border border-white border-opacity-10 text-white w-1/3 flex flex-row border border-white border-opacity-15">
                        <div className="p-8 rounded-lg text-white w-2/3">
                            <h1 className="text-2xl font-bold text-center">{formSettings.formTitle}</h1>
                            <p className="text-center text-white opacity-70">{formSettings.formDescription}</p>
                                <div class="relative flex items-center">
                                    <input name="email" type="text" required class="w-full bg-white bg-opacity-5 text-neutral-300 text-sm border border-white border-opacity-15 px-4 py-3 rounded-md focus:outline-none" placeholder="Enter email" />
                                </div>
                        </div>
                        <div className="rounded-lg text-white w-1/3">
                            <img src={FeedbackImage} alt="Feedback" />
                        </div>
                    </div>
                </div>
            ) : (
                <div>Light Theme</div>
            )}
        </>
    );
};

export default FeedbackForm;
